import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

export default function Navbar() {
    const navigate = useNavigate();
    return (
        <div className="flex list-none justify-end items-center space-x-4 mr-4 text-indigo-700 font-semibold text-xl py-8 shadow-md bg-gray-300">
            <li>
                <Link to="/forms">Forms</Link>
            </li>
            <li>
                <Link to="/response-form">Saved Form</Link>
            </li>
            <li>
                <Link to="/form">Create Form</Link>
            </li>
            <li>
                <button
                    // className="px-3 py-2 bg-red-700 hover:bg-red-800 rounded-md text-white"
                    onClick={() => {
                        localStorage.removeItem('user');
                        navigate('/login');
                    }}
                >
                    LOGOUT
                </button>
            </li>
        </div>
    );
}
